var PropertyPaneBasic = (function () {
    function PropertyPaneBasic(serverURL) {
        this._serverURL = serverURL;
    }
    PropertyPaneBasic.prototype.TestName = function () {
        return 'PropertyPane Test';
    };
    PropertyPaneBasic.prototype.TestOwner = function () {
        return 'dagaeta';
    };
    PropertyPaneBasic.prototype.TestIncludeScripts = function () {
        return [
            '<ProductScriptsLocation>msajaxbundle.debug.js',
            '<ProductScriptsLocation>sp.runtime.debug.js',
            '<ProductScriptsLocation>sp.debug.js',
            '<TestLocation>/TabTaskLib.debug.js',
            '<AzureTaskLibLocation>/sp-tab-tasklib.js'
        ];
    };
    PropertyPaneBasic.prototype.TestSetup = function () {
        TAB.Log.Comment('PropertyPane basic test start');
    };
    PropertyPaneBasic.prototype.TestRun = function () {
        TAB.AddTask(TAB.MakeTask(function () {
            var pageContentClassName = SPTaskLib.Pages.Workbench.pageContentClassName;
            SPTaskLib.PageUtil.AddTaskCreateWorkbench();
            SPTaskLib.Pages.Workbench.AddTaskClearSecurityDialog();
            var emptyWebpart = new SPTaskLib.Controls.BaseWebpart(SPTaskLib.Controls.WebpartType.Unknown, '61cfbba8-f0af-4b82-80da-39793b8e8530_0');
            SPTaskLib.Pages.Canvas.AddTaskCreateWebPart(emptyWebpart, pageContentClassName);
            SPTaskLib.PageUtil.AddTaskValidateAutomationIdExists('EmptyWebPartContentText');
            SPTaskLib.Pages.PropertyPane.AddTaskOpenPropertyPane();
            SPTaskLib.Pages.PropertyPane.AddTaskVerifyEmptyPropertyPane();
            SPTaskLib.Pages.PropertyPane.AddTaskClosePropertyPane();
            var propertyPaneWebpart = new SPTaskLib.Controls.BaseWebpart(SPTaskLib.Controls.WebpartType.Unknown, '36c1bab8-0928-48c3-91ec-92d83f650d94_0');
            SPTaskLib.Pages.Canvas.AddTaskCreateWebPart(propertyPaneWebpart, pageContentClassName);
            SPTaskLib.PageUtil.AddTaskValidateAutomationIdExists('PropertyPaneTestWebPartContentText');
            SPTaskLib.Pages.PropertyPane.AddTaskOpenPropertyPane();
            SPTaskLib.Pages.PropertyPane.AddTaskVerifyNonEmptyPropertyPane();
            SPTaskLib.Pages.PropertyPane.AddTaskClosePropertyPane();
        }));
        TAB.Log.AddTaskPass('Test complete');
    };
    return PropertyPaneBasic;
}());
TabTest = PropertyPaneBasic;
